package jobCourseJava;

public class operadoreslogicos {
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10, b = 5;
		
		/*
		 * operadores logico
		 * e - &&
		 * ou - ||
		 * not - !
		 */
		
		if (!(a > b)){
			System.out.println("Sim");
		}else{
			System.out.println("Não");
		}
		
	}
}